import { title } from "assets/jss/material-kit-react.jsx";

const activityStyle = {
  section: {
    padding: "70px 0"
  },
  title: {
    ...title,
    marginBottom: "50px",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
    textAlign: "center"
  },
  typo: {
    marginBottom: "60px",
    marginTop: "50px",
    position: "relative",
    width: "100%"
  },
  description: {
    color: "#999",
    textAlign: "center"
  },
};

export default activityStyle;
